python3 -c "
import json, subprocess
# Use macOS's built-in Python to sample specific pixels from the icon
# The magnifying glass ring is around the center-top area
# Let's use CoreImage via osascript
result = subprocess.run([
    'osascript', '-l', 'JavaScript', '-e', '''
    ObjC.import('AppKit');
    var img = \$.NSImage.alloc.initWithContentsOfFile('/Users/al02402336/everything/src-tauri/icons/icon.png');
    var rep = img.representations.objectAtIndex(0);
    var colors = [];
    // Sample points where we expect the green magnifying glass
    var points = [[256,150],[200,200],[300,200],[256,256],[180,300],[150,350]];
    for (var i = 0; i < points.length; i++) {
        var x = points[i][0];
        var y = points[i][1];
        var c = rep.colorAtXY(x, y);
        if (c) {
            var r = Math.round(c.redComponent * 255);
            var g = Math.round(c.greenComponent * 255);
            var b = Math.round(c.blueComponent * 255);
            var a = Math.round(c.alphaComponent * 255);
            colors.push(x + ',' + y + ': #' + ('0'+r.toString(16)).slice(-2) + ('0'+g.toString(16)).slice(-2) + ('0'+b.toString(16)).slice(-2) + ' a=' + a);
        }
    }
    colors.join('\\n');
    '''
], capture_output=True, text=True)
print(result.stdout)
print(result.stderr)
"

